import { InputText, Password } from "primereact";
import { ButtonPrimary } from "../../../shared/components/buttons/ButtonPrimary";
import { useStateInputLogin } from "../../hooks/login.hooks";
import { handleSubmit } from "./Form.component";
export const FormHtml = () => {
  return (
    <div className="container">
      <div className="row">
        <h1>hello Wolrd</h1>
      </div>
      <form action="">
        <h5>Left Icon</h5>
        <span className="p-input-icon-left">
          <i className="pi pi-user" />
          <InputText
            name="username"
            onChange={(e) => useStateInputLogin(e)}
            placeholder="Username"
          />
        </span>
        <h5>Show Password</h5>
        <Password
          name="password"
          onChange={(e) => useStateInputLogin(e)}
          toggleMask
        />
        <ButtonPrimary
          icon="pi pi-check"
          iconsPos="left"
          label="Save"
          handleClick={handleSubmit}
        />
      </form>
    </div>
  );
};
